Eine Sparrenklaue ist die häufigste Verbindung bei Dachstühlen und Terrassendächern. Dabei handelt es sich um eine Einkerbung der Sparren, die auf den Pfetten aufliegen.
&lt;ul&gt;
&lt;li&gt;Auslassung im Sparren, Auslasstiefe = halbe Sparrenhöhe&lt;/li&gt;
&lt;li&gt;Kompakteres Erscheinungsbild&lt;/li&gt;
&lt;li&gt;Mehr Durchgangshöhe&lt;/li&gt;
&lt;li&gt;Dachüberstand der Traufseite durch Klaue fix&lt;/li&gt;
&lt;/ul&gt;
